import React, { ReactElement } from "react";

interface BlocksType {
  text: string;
  description: string;
}

const Blocks = (props: BlocksType): ReactElement => {
  return (
    <>
      <div className="center-contents" style={{ height: "10em", width: "14em", backgroundColor: "grey", display: "flex", flexDirection: "column" }}>
        <div style={{ marginBottom: "2em" }}>{props.text}</div>
        <div>{props.description}</div>
      </div>
    </>
  );
}

export default Blocks;
